import Trabajadores from "./Empleado.json";
import React, { Component } from "react";
import JuanManuel from "../../Images/personal1@2x.png";
import AnaIsabel from "../../Images/personal2@2x.png";
import MariaPaulina from "../../Images/personal3@2x.png";
import JorgeRausch from "../../Images/Rausch.jpeg";
import JordyCruz from "../../Images/Jordy Cruz.jpeg";
import FerrAdria from "../../Images/ferranadriados.jpg";


class Empleados extends Component {
  render() {
    return (
      <>
        <div className="trabajadores">
          <div className="row align-items-start">
            {Trabajadores.Fila1.map((trabajador) => {
              return (
                <div className="Trabajador col">
                  <img src=<script>Imagenes(trabajador.id);</script> alt="Empleado tal" />
                  
                  <h3>{trabajador.Nombre}</h3>
                  <h6>{trabajador.cargo}</h6>
                </div>
              );
            })}
          </div>
          <div className="row align-items-start">
            {Trabajadores.Fila2.map((trabajador) => {
              return (
                <div className="Trabajador col">
                  <img src={trabajador.imgPerfil} alt="Empleado tal" />
                  <h3>{trabajador.Nombre}</h3>
                  <h6>{trabajador.cargo}</h6>
                </div>
              );
            })}
          </div>
        </div>
      </>
    );
  }
}

export default Empleados;
